import {Injectable} from '@angular/core'

@Injectable()
export class AppConfig {
    private _config: {[key:string]: string};

    constructor(){
        this._config = {
            PathAPI: 'https://localhost:7079'
        };
    }

    get setting(): {[key:string]: string} {
        return this._config
    }

    get(key: string){
        return this._config[key];
    }
}
